/**
 * A JSON-LD document term
 */
export interface JsonLdDocumentTermInfo {
    /**
     * The compacted term
     */
    readonly name: string;
    /**
     * The fully qualified term IRI
     */
    readonly iri?: string;
    /**
     * The value type IRI
     */
    readonly valueTypeIri?: string;
    /**
     * Indicates whether the term is a JSON-LD type
     */
    readonly isJsonLdKeyword: boolean;
}
